import React,{useState} from "react";
import {FaAngleRight}  from 'react-icons/fa';


function Card({info,setShow}){

return(
      
<div className="card" onClick={()=>setShow(info)} >
  <div>
    <div className="card1"><img src="https://kolesa-uploads.ru/-/f8cebc96-e521-4f62-85cf-31b4357decd5/preview-bmw-x5l.jpg" height={"150vh"} width={"200vw"} border={"1px solid black"}></img></div>
    <div><ul>
     <li ><FaAngleRight/><span>{info.marka}</span></li>
        <li><FaAngleRight/><span>{info.model}</span></li>
        <li><FaAngleRight/><span>{info.year}</span></li>
        <li><FaAngleRight/><span>COST:10000</span></li>
    </ul>
    </div>
    </div>
    <div className="card2"><p>{info.information}</p></div>
</div>




    )
   
}

export default Card
